import styled from 'styled-components'

const Container = styled.main`
  margin-top: 10rem;
  padding: 0;
  width: 50%;
  height: 100vh;
  display: flex;
  background-color: #fefefe;  
`

const Layout = props => (
  <>
    <Container>
      { props.children }
    </Container>

    <style jsx global>{`
      *{
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      body{
        background-color: #292929;
        font-size: 10px;
      }

      #__next{
        height: 100%;
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center;
      }
    `}</style>
  </>
)

export default Layout
